【コンボ キャット 連パック 肥満が気になる猫用の詳細】<br>
●４０ｇ×４袋の食べきりサイズ。どこからでも切れるマジックカット採用。<br>
●おいしさそのまま低脂肪。食物繊維で満腹感アップの肥満が気になる猫用。<br>
●避妊・去勢後にもおすすめ。<br>
●まぐろ味に風味豊かなかつおぶし、カルシウム豊富な本物小魚を添えたメニュー。<br>●猫下部尿路の健康維持に配慮した、低マグネシウム設計。（マグネシウム含有量０．１２％：標準値）<br>
●総合栄養食。<br><br>

【原材料】<br>
穀類（トウモロコシ、コーングルテンミール、小麦粉、パン粉）、肉類（チキンミール、牛肉粉、豚肉粉）、魚介類（小魚、フィッシュミール、カツオブシ、フィッシュパウダー、マグロ節粉、マグロエキス、小魚粉末、カツオエキス、シラスパウダー）、油脂類（動物性油脂、植物性油脂、γーリノレン酸）、脱脂大豆、オリゴ糖、ハーブ（タイム、ディル、フェンネル）、野菜類（トマト、ニンジン、ホウレンソウ）、クランベリーパウダー、ミネラル類（カルシウム、リン、カリウム、ナトリウム、クロライド、銅、亜鉛、ヨウ素）、ｐＨ調整剤、酵母細胞壁、アミノ酸類（タウリン、トリプトファン、メチオニン）、ビタミン類（Ａ、Ｂ１、Ｂ２、Ｂ６、Ｂ１２、Ｄ、Ｅ、Ｋ、ニコチン酸、パントテン酸、葉酸、コリン）、着色料（二酸化チタン、食用赤色１０２号、食用赤色１０６号、食用黄色５号、食用青色１号）、酸化防止剤（ミックストコフェロール、ローズマリー抽出物）、グルコサミン、コンドロイチン<br><br>

【保証成分】<br>
たんぱく質27.0%以上､脂質8.1%以上､粗繊維4.5%以下､灰分9.0%以下､水分10.0%以下､カルシウム0.9%以上､リン0.8%以上､マグネシウム 標準値0.12%<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量等】<br>
区分：総合栄養食<br>
フードタイプ：ドライタイプ<br>
対象年齢：成猫用<br>
内容量：１６０ｇ（４０ｇ×４連）<br>
原産国：日本日
カロリー：350kcal/100g<br><br>

【販売元】<br>
日本ペットフード<br>
東京都品川区東品川2-2-4 天王洲ファーストタワー5階<br>
お電話：03-6711-3601<br><br>

【商品区分】<br>
ペット用品<br><br>

[キャットフード　猫用総合栄養食] 

<br><br><br><hr>
広告文責：株式会社モリキ<br>
